import Content from"../components/list_projects_page/Content";
import Footer from "../components/list_projects_page/Footer";
import Header from "../components/list_projects_page/Header";


import styled from 'styled-components';

// import { GlobaStyle } from '../components/list_projects_page/styles';

const Warpper = styled.div`
html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset,  legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed, 
figure, figcaption, footer, header, hgroup, 
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
	margin: 0;
	padding: 0;
	border: 0;
	font-size: 100%;
	font: inherit;
	vertical-align: baseline;
}

 font-family: 'Roboto', sans-serif;
 display:flex;
 height:100vh;
 padding:0;
 margin:0;
 border:0;
 flex-direction: column;
 justify-content: space-between;

`

function App(){
    return (
    <Warpper>
        <Header/>
        <Content/>
        <Footer/>
    </Warpper>
    )
}

export default App
